class SubarraySumsDivisibleByK:
    def subarraySumsDivisibleByK(self, A, K):
        res = 0
        # construct prefix sum
        P = [0]*(len(A)+1)
        for i in range(len(A)):
            P[i+1] = P[i] + A[i]
        # keep a set to remember all previous divisibles found
        memoization = set()

        for i in range(len(P)):
            for j in range(i+1, len(P)):
                summ = P[j] - P[i]
                if summ in memoization or summ % K == 0:
                    memoization.add(summ)
                    res += 1
        return res


